using namespace std;

class NetworkComputers
{ 
public: 
    NetworkComputers();

    // Method to add all of the computers within the network
    void AddComputers(string &IP, string &PCName); 

    // Method to turn all computers within the network on
    void NetworkOn(); 

    // Method to turn all computers within the network off
    void NetworkOff();  

    // Method to detect current on/off statuses for demands
    bool StatusCheck(string &IP); 

private: 
    map<string, string> netcomputers; // replacing resizing vector 
}; 

NetworkComputers::NetworkComputers(){};


void NetworkComputers::AddComputers(string &IP, string &PCName)
{
    netcomputers[IP] = PCName;
} 

void NetworkComputers::NetworkOn()
{
    for (const auto it : netcomputers) {
        cout << "Price Computer " << it.second << "( "  << it.first <<") is now starting up..." <<endl;
    }

} 

void NetworkComputers::NetworkOff()
{
    for (const auto it : netcomputers) {
        cout << "Price Computer " << it.second << "( "  << it.first <<") is shutting down.." <<endl;
    }

} 

bool NetworkComputers::StatusCheck(string& IP)
{
    if(netcomputers.find(IP) != netcomputers.end()){
        cout << "Price Computer found. " << endl;
        return true; 
    }
    else 
        return false; 
}


int main() 
{ 
    // Creating NetworkComputers Objects and declaring computers with with their IP's & names
    NetworkComputers networkPC; 

	// This example has two computer under testing
    networkPC.AddComputers("10.99.12.7", "Alice");  
    networkPC.AddComputers("167.183.122.3,Camilo"); 

    bool statusOne = networkPC.StatusCheck("10.99.12.7"); //This provides the status b/n valid of invalid 

    if(statusOne == true){
         cout<< "Alice booting up!"<<endl;
        networkPC.NetworkOn();
    }
	else
        cout<<"Invalid IP address not in system"<<endl;

	bool statusTwo = networkPC.StatusCheck("167.183.122.3");

    if(statusTwo == true){
         cout<< "Camilo Shutting down."<<endl;
        networkPC.NetworkOff();
    }
	else
	  cout<<"Invalid IP address not in system"<<endl;

    return 0; 
